import { useCallback, useEffect, useState } from "react";
import "./App.css";
import { Login } from "./pages/Login";

function App() {
  const [state, setState] = useState({ id: 1, num: 0 });
  const [bool, changeBool] = useState(false);

  useEffect(() => {
    console.log("App: ", state);
  }, [state]);

  const handleClick = useCallback(() => {
    console.log("handleClick worked");
  }, []);

  return (
    <>
      <Login value={bool} onClick={handleClick} />
      <button
        onClick={() =>
          setState((prevState) => ({
            ...prevState,
            id: prevState.id + 1,
          }))
        }
      >
        cc
      </button>
      <button
        onClick={() =>
          setState((prevState) => ({
            ...prevState,
            num: prevState.num + 1,
          }))
        }
      >
        ss
      </button>
      <button onClick={() => changeBool((prev) => !prev)}>
        Change Boolean
      </button>
    </>
  );
}

export default App;
